import React from "react";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";

function Navbar() {
  return (
    <AppBar title="My App">
      <Toolbar>
        <TypoGraphy variant="title" color="inherit">
          My header
        </TypoGraphy>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
